import React from "react";

class Navigation extends React.Component {
    render() {
      return <div class="md:flex p-5">
          <a class="flex-auto">Homepage</a>
          <div class="object-right hidden md:inline-block">
            <a class="m-10 hover:text-gray-600">About</a>
            <a class="m-10">Pricing</a>
          </div>

      </div>;
    }
  }

export default Navigation
